import { DatePipe } from '@angular/common';
import { Component, OnInit } from '@angular/core';
import { NgForm } from '@angular/forms';
import jwtDecode from 'jwt-decode';
import { CourseInfoService } from 'src/app/shared/course-info.service';
import { CourseReg } from 'src/app/shared/course-reg.model';
import { CourseRegService } from 'src/app/shared/course-reg.service';
import { StudentInfoService } from 'src/app/shared/student-info.service';

@Component({
  selector: 'app-reg-course',
  templateUrl: './reg-course.component.html',
  styleUrls: ['./reg-course.component.css']
})
export class RegCourseComponent implements OnInit {
  tokenPayload:any;
  coursesNotChosen:any[];
  constructor(public objService:CourseRegService, public courseService:CourseInfoService,
    public studentService:StudentInfoService, public datePipe: DatePipe ){}
  ngOnInit(): void {
    const token: any = localStorage.getItem('authToken');
    this.tokenPayload = jwtDecode(token);
    this.resetForm();

    this.studentService.getStudentInfo(this.tokenPayload.AdminId).then(() => {
      // CourseRegAddOnList is populated, now filter FacultyList again
      this.getAvailableCourses(this.studentService.StudentData.DepartmentId)
      console.log(this.courseService.CourseAddOnList)
    });


    this.coursesNotChosen = this.courseService.CourseAddOnList.filter(
      course => {
        return !this.objService.CourseRegAddOnList.some(
      chosenCourse => chosenCourse.CourseId ===course.CourseId );
     });


  console.log(this.coursesNotChosen)
}


  getAvailableCourses(id){
    this.courseService.getAllCourses(id);
  }

  resetForm(form?:NgForm){
    if(form!=null)
    {
      form.form.reset();
    }
    else{
      const currentDate = new Date();
      const formattedDate = this.datePipe.transform(currentDate, 'yyyy-MM-dd');
      this.objService.CourseRegData = {StudentId:this.tokenPayload.AdminId, CourseId:"", DateOfReg: formattedDate};
    }
  }

  onSubmit(form:NgForm)
  {
    this.objService.postCourseReg().subscribe(res=>
      {
        this.resetForm(form);
        this.objService.getCourseRegList();
        alert('Course Registered Successful!');
      },
      err=>{alert('Error!' + err);})
  }


}
<div class="container">
    <div class="row justify-content-center">
      <div class="col-md-6">
        <form #form="ngForm" autocomplete="off" (submit)="onSubmit(form)">


          <div class="form-group">
            <label for="BranchId">Student Id</label>
            <div class="input-group">
              <div class="input-group-prepend">
                <span class="input-group-text bg-white">
                  <i class="fa fa-user-circle-o" aria-hidden="true" [class.green-icon]="StudentId.valid"
                    [class.red-icon]="StudentId.invalid && StudentId.touched"></i>
                </span>
              </div>
              <input name="StudentId" #StudentId="ngModel" [(ngModel)]="objService.CourseRegData.StudentId" id="StudentId"
                class="form-control" placeholder="Student Id" required>
            </div>
          </div>

          <div class="form-group">
            <div class="input-group">
                <div class="input-group-prepend">
                    <div class="input-group-text bg-white">
                        <i class="fa fa-diamond" aria-hidden="true" [class.green-icon]="CourseId.valid"
                            [class.red-icon]="CourseId.invalid && CourseId.touched"></i>
                        <select name="CourseId" #CourseId="ngModel" id="CourseId"
                            [(ngModel)]="objService.CourseRegData.CourseId" class="form-control" required>
                            <option *ngFor="let course of coursesNotChosen" [value]="course.CourseId">{{
                              course.CourseName }}</option>
                        </select>
                    </div>
                </div>
            </div>
        </div>


          <div class="form-group">
            <div class="input-group">
                <div class="input-group-prepend">
                    <div class="input-group-text bg-white">
                        <i class="fa fa-diamond" aria-hidden="true" [class.green-icon]="DateOfReg.valid"
                            [class.red-icon]="DateOfReg.invalid && DateOfReg.touched"></i>
                        <input type="date" name="DateOfReg" #DateOfReg="ngModel" [(ngModel)]="objService.CourseRegData.DateOfReg" placeholder="DateOfReg"
                            class="form-control" required>
                    </div>
                </div>
            </div>
        </div>


          <div class="form-group">
            <button class="btn btn-success btn-lg" type="submit" [disabled]="form.invalid">
              <i class="fa fa-database"></i> Registered for Course
            </button>
          </div>

        </form>
      </div>
    </div>
  </div>
